(1, 'Apple MacBook Pro Retina 13" 2015 MF840D/A 2.7GHz, 8GB, 256GB SSD, Intel Iris Graphics, OS X', '<p>In den neuen MacBook Pro Notebooks von Apple kommt ein Retina Display mit IPS-Technologie zum Einsatz. Das 13 Zoll große Display löst mit sagenhaften&nbsp;2560&nbsp;x&nbsp;1600 Bildpunkten auf. Das sind über 5.1 Millionen Pixel, die auf diesem Display dargestellt werden. Zum Vergleich: Bisher war die Full-HD-Auflösung mit 1920 x 1080 (~ 2.1 Millionen Pixel) das Maximum, was ein Notebook-Bildschirm darstellen konnte. Das neue Retina-Display sorgt für noch nie da gewesene Farbbrillanz und ein besseres Kontrastverhältnis als bei einem MacBook Pro mit normalem Display. Die IPS-Technologie bietet einen Betrachtungswinkel von 178 Grad, sodass Sie den Bildschirminhalt quasi aus jedem Blickwinkel erkennen können. Mittig im Displayrahmen hat Apple außerdem eine FaceTime HD Kamera mit 1.0 Megapixel integriert.</p>', '<li>33,78 cm (13,3“) Retina Display, LED-Backlight und IPS - Technologie</li>\r\n<li>Auflösung 2560 x 1600</li>\r\n<li>Intel® Core™ i5 Prozessor der fünften Generation (2.70 GHz, 3MB Intel® Smart-Cache) mit Intel® Turbo Boost bis zu 3.10 GHz</li>\r\n<li>Intel Iris Graphics 6100</li>\r\n<li>8 GB LPDDR3 1866 MHz Arbeitsspeicher</li>\r\n<li>256 GB-SSD-Flashspeicher</li>\r\n<li>WLAN 802.11ac, Bluetooth 4.0</li>\r\n<li>HDMI, 2x Thunderbolt 2, 2x USB 3.0, Firewire</li>\r\n<li>Mac OS X</li>', 'http://media.nbb-cdn.de/images/products/210000/214112/Apple_Kategorie_MacBook_Pro_Retina.jpg?size=400', 'http://media.nbb-cdn.de/images/products/210000/214112/Apple-MacBook-Pro13-2013_01.jpg?size=400', 'http://media.nbb-cdn.de/images/products/210000/214112/Apple-MacBook-Pro13-2013_03.jpg?size=400', 1, 8, 1419.99, , , );
INSERT INTO `produkte` (`id`, `produktname`, `produktbeschreibung`, `produktfeatures`, `bild1`, `bild2`, `bild3`, `kategorie`, `lagerbestand`, `preis`, `img1`, `img2`, `img3`) VALUES
(2, 'Apple MacBook Pro 15" Retina 2015 MJLT2D/A 2.5GHz, 16GB, 512GB SSD, Radeon R9 M370X 2GB', '<p>.In den neuen MacBook Pro Notebooks von Apple kommt ein Retina Display mit IPS-Technologie zum Einsatz. Das 15 Zoll große Display löst mit sagenhaften 2880 x 1800 Bildpunkten auf. Das sind über 5.1 Millionen Pixel, die auf diesem Display dargestellt werden. Zum Vergleich: Bisher war die Full-HD-Auflösung mit 1920 x 1080 (~ 2.1 Millionen Pixel) das Maximum, was ein Notebook-Bildschirm darstellen konnte. Das neue Retina-Display sorgt für noch nie da gewesene Farbbrillanz und ein besseres Kontrastverhältnis als bei einem MacBook Pro mit normalem Display. Die IPS-Technologie bietet einen Betrachtungswinkel von 178 Grad, sodass Sie den Bildschirminhalt quasi aus jedem Blickwinkel erkennen können. Mittig im Displayrahmen hat Apple außerdem eine FaceTime HD Kamera mit 720p integriert.\r\n \r\nNeben dem hochauflösenden Retina-Display ist das MacBook Pro mit leistungsstarker Computer-Hardware ausgestattet. Hierzu zählen unter anderem eine kraftvolle QuadCore-CPU von Intel, viel Arbeitsspeicher und ein 512GB großer Flashspeicher. Der in diesem Gerät verbaute Flashspeicher ist dank PCI Lösung bis zu 50% schneller als in den Vorgängermodellen.</p>', '<li>39,11 cm (15,4“) Retina Display, LED-Backlight und IPS - Technologie</li>\r\n<li>Auflösung 2880 x 1800</li>\r\n<li>Intel® Core™ i7 Prozessor der vierten Generation (2.50 GHz, 6MB Intel® Smart-Cache) mit Intel® Turbo Boost bis zu 3.70 GHz &nbsp;</li>\r\n<li>AMD Radeon R9 M370X 2GB / Intel Iris Pro Graphics</li>\r\n<li>16 GB DDR3L 1600 MHz Arbeitsspeicher</li>\r\n<li>512 GB-Flashspeicher</li>\r\n<li>WLAN 802.11ac, Bluetooth 4.0</li>\r\n<li>HDMI, 2x Thunderbolt 2, 2x USB 3.0</li>\r\n<li>Mac OS X<br></li>', 'http://media.nbb-cdn.de/images/products/220000/223679/small_slider_MacBookPro15_GRAFIK_DE_01.jpg', 'http://media.nbb-cdn.de/images/products/220000/223679/MacBookPro15_GRAFIK_DE_04.jpg?size=400', 'http://media.nbb-cdn.de/images/products/220000/223679/MacBookPro15_GRAFIK_DE_05.jpg?size=400', 1, 4, 2349.99, , , );
INSERT INTO `produkte` (`id`, `produktname`, `produktbeschreibung`, `produktfeatures`, `bild1`, `bild2`, `bild3`, `kategorie`, `lagerbestand`, `preis`, `img1`, `img2`, `img3`) VALUES
(3, 'Apple MacBook Air 13" MMGF2D/A 1.6GHz, 8GB Ram, 128GB SSD, OS X - 2016', '<p>Apple-Produkte sind wertstabil, langlebig und verfügen über ein minimalistisches Design. Apple-eigene Software und das OS X Betriebssystem stehen für kompromisslose Benutzerfreundlichkeit und intuitive Bedienung. Hochwertige Prozessoren, Grafiklösungen und Speicher sorgen dafür, dass für alle Aufgaben und Anwendungen stets genug Leistung zur Verfügung steht. Und wenn das alles in ein verschwindend leichtes und flaches MacBook verpackt wird, heißt das MacBook Air </p>', '<li>33 cm (13") Display, LED-Backlight</li>\r\n<li>Auflösung 1440 x 900 Pixel</li>\r\n<li>Intel® Core™ i5 Prozessor der fünften Generation 1.60 GHz mit Intel® Turbo Boost bis zu 2.70 GHz</li>\r\n<li>Intel HD Graphics 6000</li>\r\n<li>8 GB LPDDR3 1600 MHz SDRAM Arbeitsspeicher</li>\r\n<li>128 GB PCIe basierter Flashspeicher (SSD)</li>\r\n<li>Beleuchtete Tastatur (Deutsch) &amp; Benutzerhandbuch (Deutsch)</li>\r\n<li>Mac OS X</li>', 'http://media.nbb-cdn.de/images/products/260000/262252/md131.jpg?size=400', 'http://media.nbb-cdn.de/images/products/260000/262252/IMG_6825.jpg?size=400', 'http://media.nbb-cdn.de/images/products/260000/262252/IMG_6835.jpg?size=400', 1, 9, 969.99, , , );
