(4, 'Apple MacBook Pro Retina 13" 2015 MF839D/A 2.7GHz, 8GB RAM, 128GB SSD, OS X', '<p>In den neuen MacBook Pro Notebooks von Apple kommt ein Apple Retina Display mit IPS-Technologie zum Einsatz. Das 13 Zoll große Display löst mit sagenhaften 2560 x 1600 Bildpunkten auf. Das sind über 5.1 Millionen Pixel, die auf diesem Display dargestellt werden. Zum Vergleich: Bisher war die Full-HD-Auflösung mit 1920 x 1080 (~ 2.1 Millionen Pixel) das Maximum, was ein Notebook-Bildschirm darstellen konnte. Das neue Retina-Display sorgt für noch nie da gewesene Farbbrillanz und ein besseres Kontrastverhältnis als bei einem MacBook Pro mit normalem Display. Die IPS-Technologie bietet einen Betrachtungswinkel von 178 Grad, sodass Sie den Bildschirminhalt quasi aus jedem Blickwinkel erkennen können. Mittig im Displayrahmen hat Apple außerdem eine FaceTime HD Kamera mit 1.0 Megapixel integriert.</p>', '\r\n<li>33,78 cm (13,3“) Retina Display, LED-Backlight und IPS - Technologie</li>\r\n<li>Auflösung 2560 x 1600<br></li>\r\n<li>Intel® Core™ i5 Prozessor der fünften Generation (2.70 GHz, 3MB Intel® Smart-Cache) mit Intel® Turbo Boost bis zu 3.10 GHz &nbsp;</li>\r\n<li>Intel Iris Graphics 6100<br></li>\r\n<li>8 GB LPDDR3 1866 MHz Arbeitsspeicher</li>\r\n<li>128 GB-SSD-Flashspeicher</li>\r\n<li>WLAN 802.11ac, Bluetooth 4.0</li>\r\n<li>HDMI, 2x Thunderbolt 2, 2x USB 3.0, Firewire</li>\r\n<li>Mac OS X Yosemite</li>\r\n', 'http://media.nbb-cdn.de/images/products/220000/223679/MacBookPro15_GRAFIK_DE_05.jpg?size=400', 'http://media.nbb-cdn.de/images/products/220000/223679/MacBookPro15_GRAFIK_DE_04.jpg?size=400', 'http://media.nbb-cdn.de/images/products/220000/223679/MacBookPro15_GRAFIK_DE_03.jpg?size=400', 1, 1, 1229.99, , , );
