(5, 'Acer Aspire ES1-531-C13G Intel Celeron N3150 Quad-Core 8GB 1000GB mattes HD-Display Windows 10', '<p>Preiswert und vielseitig: Das Acer Aspire ES1-531-C13G ist ein beliebtes Notebook, das mit einer sehr großzügigen Ausstattung überzeugt. Ein mattes 15,6-Zoll-Display in HD-Auflösung lässt ein augenschonendes Arbeiten zu. Eine zügige Programausführung garantiert ein Intel Celeron Quad-Core Prozessor im Zusammenspiel mit starken 8 GB Arbeitsspeicher und 1000 GB Festplattenspeicher. Auch ohne externe Stromzufuhr ermöglicht ein leistungsstarker Akku eine lange Betriebszeit von über 5 Stunden. </p>', '<ul>\r\n<li>Display: 15,6” Zoll (39 cm), matt</li>\r\n<li>Auflösung: 1.366 x 768 Pixel (WXGA)</li>\r\n<li>Prozessor: Intel® Celeron® N3150&nbsp;Quad-Core (4x 1,6 GHz, 2 MB Cache)</li>\r\n<li>Grafik: Intel HD Graphics</li>\r\n<li>Arbeitsspeicher: 8 GB</li>\r\n<li>Festplatte: 1000 GB (5.400 U/min)</li>\r\n<li>Laufwerke: DVD Super Multi Brenner (Double Layer) DVD DL±RW/CDRW</li>\r\n<li>Kartenleser: 5-in-1 Kartenleser (SD/SD pro/MMC/MS pro/XD)</li>\r\n<li>Netzwerk: 802.11 b/g/n, 2,4/5GHz, Gigabit-Ethernet, Bluetooth® 4.0</li>\r\n<li>Anschlüsse: HDMI, 1 x USB 3.0, 2 x USB 2.0, RJ-45, 1 x Lautsprecher/Kopfhörer Line-out, 1 x Mikrofon Line-in</li>\r\n<li>Webcam: HD-Webcam</li>\r\n<li>Eingabegeräte: Tastatur mit Nummernblock, Multi-Gesture Touchpad</li>\r\n<li>Akku: 3.220 mAh (3 Zellen), Laufzeit bis zu 5,5 Stunden</li>\r\n<li>Abmessungen / Gewicht: 381,6 (B) x 258 (T) x 26,1 (H) mm / 2,4 kg</li>\r\n<li>Betriebssystem: Windows 10 Home 64-Bit</li>\r\n</ul>', 'http://media.nbb-cdn.de/images/products/230000/234376/Acer_Aspire_ES1-531_01_fv_win10wp_black_nt_glarejpg.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/234376/Acer_Aspire_ES1-531_noos_black_nt_2.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/234376/Acer_Aspire_ES1-531_win81_black_nt_4.jpg?size=400', 2, 5, 349.99, , , );
