(6, 'Acer Aspire E5-772-P3D4 Intel Pentium 4GB große 1000GB Festplatte ohne Windows', '<p>Das Acer Aspire E5-772-P3D4 ist ein attraktives Notebook, das mit einer durchdachten Ausstattung überzeugt. Für ordentliche Rechenpower des 17,3-Zoll-Notebooks sorgen ein Dual Core Prozessor von Intel und 4 GB Arbeitsspeicher. </p>', '<ul>\r\n<li>Display: 43,9 cm (17,3-Zoll), glänzend</li>\r\n<li>Auflösung: 1600 x 900 Pixel (HD+), 16:9-Format</li>\r\n<li>Prozessor: Intel® Pentium® Dual Core 3556U (2x 1,70 GHz, 2 MB)</li>\r\n<li>Arbeitsspeicher: 4 GB DDR3 RAM (1600 MHz)</li>\r\n<li>Laufwerke / Kartenleser: 8 x DVD-Brenner / SD-Card-Reader</li>\r\n<li>Festplatte: 1000 GB HDD (5400 U/min)</li>\r\n<li>Netzwerk: Gigabit-Ethernet-LAN, WLAN 802.11a/b/g/n/ac, Bluetooth® 4.0</li>\r\n<li>Anschlüsse: HDMI, VGA, 2 x USB 3.0, 2 x USB 2.0, RJ-45, Kopfhörer (Stereo), Mikrofon</li>\r\n<li>Eingabegeräte: Tastatur mit Ziffernblock, Multi-Gesture-Touchpad</li>\r\n<li>Kamera: 1,3 Megapixel HD-Webcam</li>\r\n<li>Akkulaufzeit: 4-Zellen-Akku mit 2500 mAh, Laufzeit bis zu 4,5 Stunden</li>\r\n<li>Abmessungen (B x T x H) / Gewicht: 423,3 (B) x 281,9 (T) x 27,5 (H) mm / ca. 3 kg</li>\r\n<li>Betriebssystem: ohne Betriebssystem</li>\r\n</ul>', 'http://media.nbb-cdn.de/images/products/230000/234368/01_Acer_Aspire_E5-772-773-722-752noos.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/234368/e5-772_04_.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/234368/e5-772_05_.jpg?size=400', 2, 12, 279.99, , , );
