(7, 'Acer Aspire V3-575G-52H2 Intel Core i5-6200U 8GB 500GB SSHD GeForce 940M Full HD Windows 10', '<p>Die V3-575G-Serie stellt die großzügig ausgestattete, auf Entertainment und Multimedia ausgelegte Produktpalette von Acer dar. Das zeigt sich auch beim Acer Aspire V3-575G-52H2, dessen Ausstattung einen großen, matten 15,6-Zoll-Bildschirm mit Full-HD-Auflösung, einen schnellen Intel Core i5 Prozessor der sechsten Generation, 8 GB Arbeitsspeicher sowie eine leistungsstarke, dedizierte Grafikkarte von NVIDIA umfasst. Programme, Musik und andere Daten werden auf einer großzügigen 500 GB Hybrid-Festplatte gespeichert.</p>', '<li>Display: 39,6 cm (15,6") Acer Comfy View™ mattes Hoch-Helligkeits Display mit LED-Hintergrundbeleuchtung</li>\r\n<li>Auflösung: 1.920 x 1.080 (Full-HD), 16:9</li>\r\n<li>Prozessor: Intel® Core™ i5-6200U (2x 2,3 GHz, bis zu 2,8 GHz Intel Turbo Boost, 3 MB Cache)</li>\r\n<li>Grafik: NVIDIA® GeForce® 940M mit 2 GB VRAM</li>\r\n<li>Arbeitsspeicher: 8 GB DDR3L (1333 MHz)</li>\r\n<li>Speicherlösung: 500 GB S-ATA (5.400rpm) + 8 GB SSD-Cache</li>\r\n<li>Laufwerk:  8x DVD-SuperMulti Brenner (Double Layer)</li>\r\n<li>Netzwerk: Giga-Bit-Lan, Wireless LAN (802.11 ac/a/b/g/n), Bluetooth® 4.0</li>\r\n<li>Anschlüsse: VGA, HDMI, 2x USB 3.0 (1 davon unterstützt power-off</li>\r\n<li>USB charging), 1x USB 2.0, Mikrofon und Audio-out, RJ45</li>\r\n<li>Eingabegeräte: hintergrundbeleuchtete Tastatur, Multi-Gesture-Touchpad</li>\r\n<li>Sound: 2 Stereo-Lautsprecher</li>\r\n<li>Akku: 4-Zellen Li-Ion-Akku, 2500mAh, bis zu 5 Stunden Akkulaufzeit</li>\r\n<li>Abmessungen / Gewicht: 381,6 (B) x 259 (T) x 23,9 (H) mm / ca. 2,4 kg</li>\r\n<li>Betriebssystem: Microsoft® Windows® 10 Home (64-Bit)</li>', 'http://media.nbb-cdn.de/images/products/250000/252165/acer_aspire_v3-574_v3-575_3.jpg?size=400', 'http://media.nbb-cdn.de/images/products/250000/252165/acer_aspire_v3-574_v3-575_5.jpg?size=400', 'http://media.nbb-cdn.de/images/products/250000/252165/acer_aspire_v3-574_v3-575_4.jpg?size=400', 2, 3, 649.99, , , );
