(8, 'Acer Predator 17 X GX-791-74YL Intel Core i7-6820HK 64GB 3x 512GB SSD (Raid) +2TB GeForce GTX 980 (8GB) 4K/UHD', '<p>Das neue Flagschiff der Predator Reihe ist gelandet: Die Predator 17 X Modelle haben einen Intel® Core™-i7-6820HK Desktop-Prozessor, eine NVIDIA® GeForce® GTX 980 Desktop-Grafikkarte und bis zu 64 GB DDR4-RAM unter der Haube. Das schwarze Gehäuse der Notebooks besitzt rote Elemente, die der Serie ihren dominanten Look verleihen. \r\n\r\nExtrem schnelle SSDs und eine USB 3.1-Typ C-Schnittstelle ermöglicht den schnellen Transfer von Spielen, Filmen, Fotos und anderen Dateien.\r\n\r\nDer RGB-Bildschirm des Predator 17 ist 43,9 cm (17,3") groß und löst in Ultra HD (4K) auf. Alle Modelle verfügen über IPS-Displays. Predator-Notebooks lassen sich darüber hinaus mit bis zu drei externen Bildschirmen verbinden — u.a. mit einem NVIDIA® G-SYNC™-Monitor.</p>', '<li>Display: 43,9 cm (17,3") Acer ComfyView™ Ultra-HD IPS Display 100% Adobe RGB Farbraum mit LED-Backlight (matt)</li>\r\n<li>Auflösung: 3.840 x 2.160 (Ultra HD), 16:9</li>\r\n<li>Prozessor: Intel® Core™ i7-6820HK  der sechsten Generation (4x 2.7 GHz bis zu 3.6 GHz, 8 MB Intel® Smart Cache)</li>\r\n<li>Grafik: NVIDIA® GeForce® GTX 980 mit 8 GB GB GDDR5 VRAM</li>\r\n<li>Arbeitsspeicher: 64 GB DDR4 (2133 MHz)</li>\r\n<li>Speicherlösung: 2000 GB (S-ATA, 5400 U/min) + 3x 512 GB SSD im Raid-Verbund</li>\r\n<li>Netzwerk: GigaBit-LAN, Killer™ Wireless-AC 1535, 802.11 ac/a/b/g/n Wireless LAN 2,4 &amp; 5 GHz, 2x2 MU-MIMO Technologie, Bluetooth® 4.1</li>\r\n<li>Anschlüsse: 1x HDMI (HDCP Support), 1x DisplayPort, 4x USB 3.0, 1x USB 3.1 Type C Gen2 (Thunderbolt™3), Audio-Combo-Buchse</li>\r\n<li>Eingabegeräte: hintergrundbeleuchtete Tastatur mit Nummernblock, Touchpad, belegbare Makro-Tasten</li>\r\n<li>Sound: Dolby® Audio Premium® 4 Stereo Lautsprecher mit Subwoofer</li>\r\n<li>Akku: 8-Zellen Li-Ion-Akku, 6000mAh, bis zu 7 Stunden Akkulaufzeit</li>\r\n<li>Betriebssystem: Microsoft® Windows® 10 Home (64-Bit)</li>\r\n', 'http://media.nbb-cdn.de/images/products/260000/262519/acer_predator17X_1.jpg?size=400', 'http://media.nbb-cdn.de/images/products/260000/262519/acer_predator17X_3.jpg?size=400', 'http://media.nbb-cdn.de/images/products/260000/262519/acer_predator17X_5.jpg?size=400', 2, 2, 4999.99, , , );
