(9, 'Dell XPS 13 9350 Ultrabook 13,3" Full-HD / Intel Core i7-6500U / 8 GB / 256GB SSD / Windows 10', '<p>Das weltweit kleinste Notebook mit 33-cm-Display (13 Zoll) mit dem weltweit ersten randlosen InfinityEdge-Display\r\n\r\nMehr Bildschirm, weniger zu tragen:\r\nDas praktisch randlose InfinityEdge-Display maximiert Bildschirmgröße und bringt ein 33 cm (13 Zoll) Display in einem 28 cm (11 Zoll) Rahmen unter. Mit einer Blende, die nur 5,2 mm misst, einem Gewicht von 1,22 kg und extrem schlanken 9 - 15 mm ist das XPS 13 außergewöhnlich flach und leicht.</p>', '<li>Keyboard: Tastatur, intern, Hintergrundbeleuchtung - Deutsch (QWERTZ)</li>\r\n<li>WirelessDW1820A (802.11ac, 2,4/5 GHz, 2x2) + Bluetooth 4.1BasisXPS 13 (9350)</li>\r\n<li>Abmessungen: Höhe: 9 – 15 mm (0,33 – 0,6 Zoll) Breite: 304 mm (11,98 Zoll)  Tiefe: 235 mm (7,88 Zoll)</li>\r\n<li>Gewicht ab: 1,2 kg (2,7 lbs)2 ohne Touch-Funktion, 1,29 kg (2,9 lb)2 Touch-Funktion</li>\r\n<li>Ports: USB 3.0 (2) - 1 mit PowerShare, SD-Kartenlesegerät (SD, SDHC, SDXC), Anschluss für Headset (1), Steckplatz für Noble Schloss (1), Thunderbolt™ 3 (1)</li>\r\n<li>Thunderbolt™ 3 Support: Netz-/Ladeanschluss, PowerShare, Thunderbolt 3 (40 Gbit/s bi-directional), USB 3.1 Gen 2 (10 Gbit/s), Native DisplayPort 1.2 Videoanschluss, VGA, HDMI, Ethernet und USB-A über Dell Adapter (separat erhältlich)</li>\r\n<li>Steckplätze Integrierter ArbeitsspeicherGehäuseKamera, HD-Breitbild-Webcam (720p) mit zwei digitalen Array-Mikrofonen</li>\r\n<li>Materialien Außengehäuse: CNC-gefrästes Aluminium Randloses Corning® Gorilla® Glass NBT™, Handauflage aus Kohlefaserverbundstoff mit Soft-Touch-Lackierung</li>\r\n<li>Tastatur: Chiclet-Tastatur in voller Größe mit Hintergrundbeleuchtung; Tastenhub von 1,3 mm</li>\r\n<li>Touchpad: Präzisions-Touchpad, nahtlos im Glas integrierte Taste</li>', 'http://media.nbb-cdn.de/images/products/230000/239059/xs13_9350nt_lnb_00000f90_sl_V.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/239059/xs13_9350nt_lnb_00045lf110_sl_V.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/239059/xs13_9350nt_lnb_90000t90_sl_V.jpg?size=400', 3, 7, 1269.99, , , );
INSERT INTO `produkte` (`id`, `produktname`, `produktbeschreibung`, `produktfeatures`, `bild1`, `bild2`, `bild3`, `kategorie`, `lagerbestand`, `preis`, `img1`, `img2`, `img3`) VALUES
(10, 'Dell Inspiron 17 7746-3836 / 17,3" Full-HD / Intel Core i5-5200U / 8GB / 1000GB + 8GB SSHD / 845M / Win8.1', '<p>Das Dell Inspiron 17 7000 ist ein flaches 17-Zoll-Notebook mit schnellem Intel Core i5-Prozessor, dedizierter Nvidia-Grafik und Full-HD-Touchscreen. Es überzeugt zudem mit einem robusten Gehäuse aus geschmiedetem Aluminium und mit diamantgeschliffenen Kanten.\r\nEdel, wertig und beständig: Das Premium-Notebook für den täglichen Einsatz\r\n\r\nDas Dell Inspiron 17 7000 vereint edles Design mit außerordentlicher Robustheit. Sein Gehäuse aus geschmiedetem Aluminium zeichnet sich durch eine sehr hohe Festigkeit und geringe Kratzeranfälligkeit aus und wirkt mit seinen diamantgeschliffenen, abgeschrägten Kanten ausgesprochen wertig. Stabile Scharniere, eine strapazierfähige Tastatur mit Hintergrundbeleuchtung und ein kratzfestes Display mit Corning Gorilla NBT Glas machen das Premium-Notebook sehr haltbar und wie geschaffen für den Business-Einsatz. Mit 28 Millimeter Höhe und einem Gewicht von 3,3 Kilogramm ist es zudem für ein 17-Zoll-Notebook relativ kompakt und lässt sich vergleichsweise gut transportieren. </p>', '<li>Display: 43,9 cm (17,3") Touch-Display, LED-Hintergrundbeleuchtung, Truelife</li>\r\n<li>Auflösung: 1920 x 1080 Pixel (Full HD), 16:9-Format</li>\r\n<li>Prozessor: Intel® Core™ i5-5200U Dual-Core-Prozessor der vierten Generation (2,2 GHz, bis zu 2,7 GHz mit Intel® Turbo-Boost 2.0, Intel® Hyper-Threading-Technologie, 3 MB Intel® Smart Cache)</li>\r\n<li>Grafik: NVIDIA® GeForce® GT 845M, 2 GB DDR5</li>\r\n<li>Arbeitsspeicher: 8 GB DDR3L, Dual-Channel, 1600 MHz</li>\r\n<li>Festplatte: 1000 GB + 8GB <a style="display:inline; border-top:none; padding:0px;" href="pc+hardware/solid+state+drives+ssd+pc+hardware">SSD</a> Cache SSHD<br></li>\r\n<li>Laufwerke / Card Reader: DVD Super Multi Brenner, 8-in-1-Medienkartenleser (SD, SDXC, SDHC, MMC, MMC+, MS, MS Pro, xD)</li>\r\n<li>Netzwerk: Intel® Wireless-AC 7265 (Dualband) + Bluetooth 4.0<br></li>\r\n<li>Anschlüsse: HDMI, 2 x USB 3.0 (1 x mit Ladefunktion), 2 x USB 2.0, RJ45, Kopfhörer-Mikrofon-Kombi</li>\r\n<li>Eingabegeräte: Tastatur mit Hintergrundbeleuchtung und Ziffernblock, Touchpad mit Gestenerkennung</li>\r\n<li>Akkulaufzeit: 3000 mAh, bis zu 5,5 Stunden Laufzeit</li>\r\n<li>Abmessungen (H x B x T) / Gewicht: 27,7 x 412,4 x 269,4 mm, 3,29 kg</li>\r\n<li>Audio: Stereolautsprecher mit Waves MaxxAudio® Pro Technologie, integriertes Mikrofon</li>\r\n<li>Kamera: HD-Webcam</li>\r\n<li>Besonderheit: biegefestes Gehäuse aus geschmiedetem Aluminium, Corning® Gorilla® Glass NBT™ Display</li>\r\n<li>Betriebssystem: Microsoft® Windows® 8.1 (64 Bit)</li>', 'http://media.nbb-cdn.de/product_images/main_image/Dell-Inspiron-17-77463836-p216823?size=400', 'http://media.nbb-cdn.de/images/products/210000/216823/Unbenannt-2.jpg?size=400', 'http://media.nbb-cdn.de/images/products/210000/216823/Unbenannt-3.jpg?size=400', 3, 3, 799.99, , , );
INSERT INTO `produkte` (`id`, `produktname`, `produktbeschreibung`, `produktfeatures`, `bild1`, `bild2`, `bild3`, `kategorie`, `lagerbestand`, `preis`, `img1`, `img2`, `img3`) VALUES
(11, 'Dell Vostro 3559 Intel Core i5-6200U / 4GB RAM / 128GB SSD / Windows 10 Professional', '<p>Effizient und leistungsstark: Dank der zuverlässigen Leistung von Intel® Prozessoren der vierten und fünften Generation, mit Optionen bis hin zu Core™ i5 Prozessoren, können Sie den ganzen Tag lang reibungslos und schnell arbeiten Der Core i5 Ultra-Niedrigspannungsprozessor bietet starke Leistung bei gleichzeitiger Energieeffizienz und sorgt für eine längere Akkulaufzeit.</p>', '<li>CPU: Intel Core i5-6200U, 2x 2.30GHz (Turbo-Boost 2x 2,8 GHz)</li>\r\n<li>RAM: 4GB&nbsp; (1600 MHz)</li>\r\n<li>Festplatte: 128 GB SSD </li>\r\n<li>optisches Laufwerk: DVD+/-RW DL </li>\r\n<li>Grafik: Intel HD Graphics 520</li>\r\n<li>Display: 15.6", 1366x768, non-glare </li>\r\n<li>Anschlüsse: 1x USB 3.0, 2x USB 2.0, Gbit-LAN </li>\r\n<li>Wireless: WLAN 802.11 ac, Bluetooth 4.0</li>\r\n<li>Cardreader: SD-Kartenleser</li>\r\n<li>Webcam: ja</li>\r\n<li>Betriebssystem: <strong>Windows 10 Professional 64bit, </strong>inkl. Windows 7 Pro downgrade </li>\r\n<li>Akku: Li-Ionen, 4 Zellen </li>\r\n<li>Gewicht: 2.24 kg </li>\r\n<li>Besonderheiten: Nummernblock </li>\r\n<li>Herstellergarantie: 1 Jahr</li>', 'http://media.nbb-cdn.de/images/products/260000/264815/k-Vostro_15_3000_Series_Non-Touch_Notebook_Image_003_1.jpg?size=400', 'http://media.nbb-cdn.de/images/products/260000/264815/k-Vostro_15_3000_Series_Non-Touch_Notebook_Image_003_3.jpg?size=400', 'http://media.nbb-cdn.de/images/products/260000/264815/k-Vostro_15_3000_Series_Non-Touch_Notebook_Image_003_6.jpg?size=400', 3, 6, 559.99, , , );
INSERT INTO `produkte` (`id`, `produktname`, `produktbeschreibung`, `produktfeatures`, `bild1`, `bild2`, `bild3`, `kategorie`, `lagerbestand`, `preis`, `img1`, `img2`, `img3`) VALUES
(12, 'Lenovo B50-70 MCC2GGE mattes 15,6" Display, Intel Core i3-4030U, 4GB Ram, 500GB Festplatte, Windows 8.1', '<p>Dieses Lenovo B50-70 ist ein preiswertes Mittelklasse-Notebook, das mit einem Intel® Core™ i3-4030U Dual-Core Prozessor (3MB Cache, bis zu 1.90 GHz) der 4. Generation ausgestattet ist und genug Leistung für Home-Office- und Privatanwendungen bietet. Ein mattes 15,6-Zoll-Display in HD 720p Auflösung ermöglicht ein augenschonendes Arbeiten in heller Umgebung. Zum Abspielen von Filmen und zum Erstellen von Backups besitzt das Lenovo B50-70 Notebook einen DVD-RW-Brenner.</p>', '<li>Display: 39,62 cm (15,6"), matt</li>\r\n<li>Auflösung: HD 1366 x 768 px</li>\r\n<li>Prozessor: Intel® Core™ i3-4030U Dual-Core Prozessor (3MB Cache, 1.90 GHz)</li>\r\n<li>Grafik1: Integrierte Intel® HD Grafik 4400 mit Intel® Wireless Display Technologie</li>\r\n<li>Arbeitsspeicher: 4GB RAM DDR3 L (1600 MHz)</li>\r\n<li>Festplatte: 500GB HDD Festplatte</li>\r\n<li>Laufwerke / Card Reader: DVD±RW DL, Speicherkartenleser (SD/MMC)</li>\r\n<li>Netzwerk: Gigabit-Ethernet, WLAN 802.11 b/g/n, Bluetooth 4.0</li>\r\n<li>Anschlüsse: HDMI, VGA, 2 x USB 3.0, 1 x USB 2.0, Kopfhörer- Mikrofonkombianschluss</li>\r\n<li>Eingabegeräte: Tastatur mit Nummernblock, Touchpad</li>\r\n<li>Akku: 4 Zellen 2200 mAh</li>\r\n<li>Abmessungen / Gewicht: 380 x 262 x 24,7 mm, 2,32 kg</li>\r\n<li>Kamera: 720p HD-Webcam 1.0MP</li>\r\n<li>Betriebssystem: Windows 8.1 64-Bit + kostenloses Update auf Windows 10 möglich</li>\r\n', 'http://media.nbb-cdn.de/images/products/230000/231736/lenovo_b50_70_nofprone_02.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/231736/lenovo_b50_70_nofprone_04.jpg?size=400', 'http://media.nbb-cdn.de/images/products/230000/231736/lenovo_b50_70_nofprone_05.jpg?size=400', 4, 18, 349.99, , , );
INSERT INTO `produkte` (`id`, `produktname`, `produktbeschreibung`, `produktfeatures`, `bild1`, `bild2`, `bild3`, `kategorie`, `lagerbestand`, `preis`, `img1`, `img2`, `img3`) VALUES
(13, 'Microsoft Office Home & Business 2016 [1 PC] - Word, Excel, PowerPoint, OneNote, Outlook', '<p>Entscheiden Sie sich für Office Home & Business 2016, können Sie die brandneuen Versionen  der bewährten Office-Anwendungen von Word, Excel, PowerPoint, OneNote und Outlook,  auf einem PC oder Laptop installieren und diese sowohl geschäftlich als auch privat nutzen. Greifen Sie überall ganz bequem auf Ihre Office-Dateien zu, die in Ihrem 15 GB großen  Onlinespeicher OneDrive gespeichert sind. Office Home & Business 2016 erleichtert Ihnen  die Zusammenarbeit mit anderen. Geben Sie Dokumente frei, präsentieren Sie diese Ihren  Kollegen oder bearbeiten Sie die Dokumente gemeinsam.</p>', '<li>Arbeiten Sie mit den aktuellsten Versionen1 der bewährten Office-Anwendungen Word, Excel, PowerPoint und OneNote&nbsp;</li>\r\n<li>Installieren Sie Office auf 1 PC 2</li>\r\n<li>Speichern Sie Ihre Dokumente online: Sie erhalten 15 GB kostenlosen Online-Speicherplatz auf OneDrive3</li>\r\n<li>Inklusive kommerzielle Nutzung</li>', 'http://media.nbb-cdn.de/images/products/230000/236446/office_home_business_1.jpg?size=400', NULL, NULL, 5, 99, 279.99, , '', '');

